import React, { useEffect, useState } from 'react';
import axios from 'axios';
import ResourceBox from './ResourceBox';

const BehavioralQuestionsPage = () => {
  const [questions, setQuestions] = useState([]);

  useEffect(() => {
    fetchBehavioralQuestions();
  }, []);

  const fetchBehavioralQuestions = async () => {
    try {
      const response = await axios.get('http://localhost:5000/r/behavioral-questions');
      setQuestions(response.data);
    } catch (error) {
      console.error('Error fetching behavioral questions:', error);
    }
  };

  return (
    <div>
      <h1 className="text-4xl font-bold mb-4">Behavioral Questions</h1>
      {questions.map(question => (
        <ResourceBox
          key={question._id}
          title={question.resourceTitle}
          description={question.resourceContent}
          url={question.resourceUrl}
          imageUrl="/path/to/your/image.jpg" // You can replace this with a dynamic value if needed
        />
      ))}
    </div>
  );
};

export default BehavioralQuestionsPage;
